var Afd='',Qgd='\n',vkd='\r\nFuncionalidade:\r\n- Manter Cadastro Conv\xEAnio    \r\n\r\nObjetivo:\r\n- Incluir, alterar ou excluir os Conv\xEAnios dos Planos Banc\xE1rios.   \r\n\r\nDescri\xE7\xF5es adicionais: \r\n- \xC9 poss\xEDvel identificar e vincular uma pessoa a seu superior respons\xE1vel, como uma base ou um corretor captador. \r\nConceder permiss\xE3o para que a pessoa se torne um usu\xE1rio do sistema e possa acess\xE1-lo atrav\xE9s de um Login/Senha.\r\nToda vez que um nova pessoa \xE9 cadastrada e \xE9 liberado seu acesso como usu\xE1rio, o sistema envia uma senha provis\xF3ria para o e-mail do usu\xE1rio. A senha deve ser trocada no primeiro acesso.\r\nInformar dados de conta banc\xE1ria para que as pessoas possam receber seus devidos pagamentos.    \r\n\r\nIncluir: \r\n- Orienta\xE7\xE3o: . Para realizar a a\xE7\xE3o de incluir \xE9 clicar no bot\xE3o Incluir da tela inicial de consulta. \r\nO sistema abrir\xE1 a tela de cadastro onde ser\xE1 preciso preencher algumas informa\xE7\xF5es obrigat\xF3rias na tela, depois clicar em Salvar.   \r\n\r\nAlterar:    \r\n- Para realizar a a\xE7\xE3o de alterar \xE9 preciso selecionar o registro na tela de consulta e clicar no bot\xE3o Alterar. \r\nO sistema abrir\xE1 a tela de cadastro com as informa\xE7\xF5es passiveis de altera\xE7\xE3o.    \r\n\r\nExcluir:\r\nOrienta\xE7\xE3o: . Para realizar a a\xE7\xE3o de excluir \xE9 preciso selecionar o registro na tela de consulta e clicar no bot\xE3o Excluir.\r\nUma pessoa s\xF3 pode ser exclu\xEDda do cadastro caso nenhuma outra informa\xE7\xE3o do sistema dependa deste registro. Por outro lado, o sistema permite que este cadastro possa ser alterado para situa\xE7\xE3o de inativo.    \r\n      \r\nPesquisar:\r\n- Para clicar no bot\xE3o Pesquisar, uma tela de filtro \xE9 apresentada. \xC9 preciso informar pelo menos algum filtro na tela antes de clicar em pesquisar.\r\nO sistema abrir\xE1 uma tela de consulta com resultado da pesquisa.    \r\n       \r\nImprimir:\r\n- Est\xE1 op\xE7\xE3o permite que seja impresso as informa\xE7\xF5es apresentadas na tela de consulta.   \r\n       \r\nLimpar:\r\n- Limpa todos os campos da tela   \r\n        \r\n',cld='\r\nFuncionalidade:\r\n- Manter Cadastro de Conv\xEAnio dos Planos Banc\xE1rios    \r\n\r\nObjetivo:\r\n- Incluir, alterar ou excluir informa\xE7\xF5es cadastrais sobre Conv\xEAnios.   \r\n\r\nA\xE7\xE3o: Incluir \r\n- Orienta\xE7\xE3o: Para realizar a a\xE7\xE3o de incluir \xE9  preciso preencher o campo descri\xE7\xE3o, selecionar a situa\xE7\xE3o e clicar em salvar. \r\n\r\nA\xE7\xE3o: Alterar \r\n- Orienta\xE7\xE3o: Para realizar a a\xE7\xE3o de alterar \xE9 preciso selecionar o registro na tela de consulta. O sistema retornar\xE1 na tela de cadastro as informa\xE7\xF5es para altera\xE7\xE3o. \r\n\r\nA\xE7\xE3o: Excluir \r\n- Orienta\xE7\xE3o: Para realizar a a\xE7\xE3o de excluir \xE9 preciso selecionar o registro na tela de consulta e clicar no bot\xE3o Excluir.\r\nUm registro s\xF3 pode ser exclu\xEDdo do cadastro caso nenhuma outra informa\xE7\xE3o do sistema dependa deste registro. Por outro lado, o sistema poder\xE1 executar a a\xE7\xE3o de alterar a situa\xE7\xE3o para inativo.    \r\n\r\nA\xE7\xE3o: Imprimir \r\n- Orienta\xE7\xE3o: Est\xE1 op\xE7\xE3o permite a impressao das informa\xE7\xF5es apresentadas na tela de consulta.   \r\n\r\nA\xE7\xE3o: Limpar\r\n- Limpa todos os campos da tela',Ijd=' ',Mod=' - ',eyd=' style="',fyd='"',KBd='" ',JBd='" style="',Hyd='");',bzd='", ',Gyd='";',wwd='#',Yyd='#,##0.###',Uyd='$',Jgd='$1\\.$2\\.$3-$4',Lgd='$1\\.$2\\.$3/$4-$5',PBd='%',oEd='%23',Syd='&',frd='&#160;',Oyd='&amp;',Pyd='&gt;',Qyd='&lt;',ird='&nbsp;',Ryd='&quot;',dzd="'",xEd="' border='0'>",kzd="';};",dkd="'><\/div>",fzd="']",lzd="'].join('');};",_yd='(',Wmd='(99)9999-9999',$zd='([/\\\\\\.\\*\\+\\?\\|\\(\\)\\[\\]\\{\\}$^])',Kgd='([0-9]{2})([0-9]{3})([0-9]{3})([0-9]{4})([0-9]{2})',Igd='([0-9]{3})([0-9]{3})([0-9]{3})([0-9]{2})',gzd=')',tEd=') no-repeat ',pwd='*',zyd='+',Iyd=','
